import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, { EffectCube, Navigation, Autoplay, Pagination } from 'swiper';
import './Slider.css';
import 'swiper/swiper.scss';
import 'swiper/components/effect-cube/effect-cube.scss';
import 'swiper/components/navigation/navigation.scss';

SwiperCore.use([EffectCube, Navigation, Autoplay, Pagination]);

export default () => {
  return (
    <Swiper 
        effect="cube"
        navigation
        autoplay={{ delay: 5000 }}
        pagination={{ clickable: true }}
        onSlideChange={() => console.log('slide change')}
        className='cube'>

      <SwiperSlide className='slide'><h1>Hello, my name is Charlie</h1></SwiperSlide>
      <SwiperSlide className='slide'><h1>hello</h1></SwiperSlide>
      <SwiperSlide className='slide'><h1>hello</h1></SwiperSlide>
      <SwiperSlide className='slide'><h1>hello</h1></SwiperSlide>
    </Swiper>
  );
};
